import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import VidBackground from './components/Assets/VidBackground.mp4'

useEffect(() => {
  const video = document.getElementById("background-video");
  if (video) {
    // Adjust playback rate to slow down the video
    video.playbackRate = 0.5; // Change the value as needed
  }
}, []);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <link href="https://fonts.googleapis.com/css2?family=Roboto:wght@400;700&display=swap" rel="stylesheet"></link>
    <div className="video-background">
        <video autoPlay loop muted className="fullscreen-video">
          <source src={VidBackground} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
        <div className="video-overlay"></div> {/* Add overlay here */}
      </div>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
